import React from "react";
import { useState } from "react";
import "../css/Slider.css"
class Header extends React.Component {
    constructor()
    {
        super();
        this.state = {name : "0", value : "1"}
    }
    render() {
      return (
        <div className="">
            
            
            <div className="float-left">Abc</div>
            <div className="float-right">Abc</div>
            <br></br>
            <div>{this.state.name}</div>
            <div className="range-wrap">
                <div class="range-value" id="rangeV"></div>
                <input className="custom-input-range" style={{width : "100%", color : "red"}} value={this.state.name} name="range" type="range" id="customRange1" min={0} max={100} step={10} onChange={e => this.setState({name : e.target.value})} />
            </div>
            
        </div>
      );
    }
  }
  
  export default Header;
